import Box from "@mui/material/Box";

const RoundBox = ({ side }) => {
  console.log({ side });
  return (
    <Box
      className={side}
      sx={{
        width: "auto",
        maxWidth: "600px",
        height: "100px",
        alignItems: "center",
        backgroundColor: "white",
        margin: "left",
      }}
    >
      hello
    </Box>
  );
};

export default RoundBox;
